import React, { Component } from 'react';
import { RoomContext } from '../context';

export default class extends Component {
	static contextType = RoomContext;
	render() {
		const value = this.context;
		console.log(value);
		return (
			<div>
				<div>Hello from featured rooms {value}</div>
			</div>
		);
	}
}
